import { StyleSheet } from "react-native-web";

const styles = StyleSheet.create({
    container: {
        flex: 0.3,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
    },
    switchs: {
        flexDirection: 'row'
    }
})

export {styles}
